import React, {Component} from 'react';

class Filter extends Component {
    render() {
        return (
            <div>
                <input type="text"
                       placeholder="Search"
                       value={this.state.search}
                       onChange={this.updateSearch.bind(this)}
                />
            </div>
        );
    }
}

export default Filter;
